#!/usr/bin/env bash

. ./constants.sh

cd .. ;
OUTPUT_FNAME=$VISITOR_OUTPUT_FILENAME_PREFIX"VISITORS"$OUTPUT_FILENAME_POSTFIX

mkdir -p $VISITOR_OUTPUT_FILENAME_PREFIX

gen_visitor_categories() {
    #"STUDENT" "ENGINEER" "RETIRED" "WANTED" "UNEMPLOYED" "OTHER"
    echo "${VISITOR_CATERORIES[$RANDOM % ${#VISITOR_CATERORIES[@]} ]}"
}

gen_visitor_interests() {
#All interests are unique in the list
    local INT_COUNT=$(shuf -i1-5 -n1)                   #Random interest count
#    echo "int count $INT_COUNT"
    local RESULT=""
    for (( N=1; N<=$INT_COUNT; N++ ))
    do
       local INDEX=$(shuf -i1-14 -n1)                   #Random interest from list
       local INTEREST=${INTERESTS[$INDEX]}
#       echo "Interest :  $INTEREST"
       local IN_LIST=$(echo "$RESULT" | egrep "$INTEREST")
#       echo ">>   $IN_LIST"
       if [[ -z "$IN_LIST" ]]; then
           RESULT=$RESULT""$INTEREST
           if [[ "$N" -ne "$INT_COUNT" ]]; then
                RESULT=$RESULT", "
           fi
       else
           N=$((N-1))
       fi
    done

    echo "${RESULT}"
}

