view_progress() {

    PROGRESS=$1
    TOTAL=$2

    LEN=$(( $(echo "$TOTAL" | wc -c)*2+3 ))
    for (( Z=1; Z<$LEN; Z++ )) {
        printf "\b"
    }

    printf "$PROGRESS / $TOTAL"
}

echo "Generating visitor living addresses ..."
VISITOR_LIVING_ADDRESSES=$(gen_visitor_addresses)
echo "Done!!!"

echo "Generating visitor delivery addresses ..."
VISITOR_DELIVERY_ADDRESSES=$(gen_visitor_addresses)
echo "Done!!!"

echo "Generating visitor bank data ..."
VISITOR_BANK_DATA=$(gen_visitor_bankdata)
echo "Done!!!"

echo "Generating visitor personal data ..."
VISITOR_PERSONAL_DATA=$(gen_visitor_personal_data)
echo "Done!!!"

echo "Processing data ..."
echo "visitors:" > $OUTPUT_FNAME

for (( N=1; N<8000; N++ )) {
    view_progress $N 8000

    VISITOR_ID=${N}
    FIRSTNAME=$(echo "$VISITOR_PERSONAL_DATA"  | jq '.['$N'] .firstname' )
    LASTNAME=$(echo "$VISITOR_PERSONAL_DATA"  | jq '.['$N'] .lastname' )
    BIRTHDATE=$(echo "$VISITOR_PERSONAL_DATA"  | jq '.['$N'] .birthdate' )

    PHONE=$(echo "$VISITOR_PERSONAL_DATA"  | jq '.['$N'] .phone' )
    GENDER=$(echo "$VISITOR_PERSONAL_DATA"  | jq '.['$N'] .gender' | awk '{ print toupper($0) }' | tr -d '"' )
    EMAIL=$(echo "$VISITOR_PERSONAL_DATA"  | jq '.['$N'] .email' )
    INTERESTS=$(gen_visitor_interests)

    CATEGORY=$(gen_visitor_categories)

    LIVING_ADDRESS_CITY=$(echo "$VISITOR_LIVING_ADDRESSES"  | jq '.['$N'] .city' )
    LIVING_ADDRESS_STREET=$(echo "$VISITOR_LIVING_ADDRESSES"  | jq '.['$N'] .street' )
    LIVING_ADDRESS_POSTALCODE=$(echo "$VISITOR_LIVING_ADDRESSES"  | jq '.['$N'] .postalCode // empty')
    LIVING_ADDRESS_ADDITIONAL_INFO=''

    DELIVERY_ADDRESS_CITY=$(echo "$VISITOR_DELIVERY_ADDRESSES"  | jq '.['$N'] .city' )
    DELIVERY_ADDRESS_STREET=$(echo "$VISITOR_DELIVERY_ADDRESSES"  | jq '.['$N'] .street' )
    DELIVERY_ADDRESS_POSTALCODE=$(echo "$VISITOR_DELIVERY_ADDRESSES"  | jq '.['$N'] .postalCode // empty')
    DELIVERY_ADDRESS_ADDITIONAL_INFO=''

    DEBTS=''
    PAYMENTS=''

    BANKDATA_CARD_NUMBER=$(echo "$VISITOR_BANK_DATA"  | jq '.['$N'] .cardNumber' )
    BANKDATA_BANK_ACCOUNT=$(echo "$VISITOR_BANK_DATA"  | jq '.['$N'] .bankAccount' )
    BANKDATA_CVV_CODE=$(echo "$VISITOR_BANK_DATA"  | jq '.['$N'] .cvvCode' )
    BANKDATA_EXPIRY_DATE=$(echo "$VISITOR_BANK_DATA"  | jq '.['$N'] .expiryDate' )
    BANKDATA_CARD_HOLDER=$(echo "\"$(echo "$FIRSTNAME $LASTNAME" | tr -d '"')\"")

#   Visitor_data saving to file...
    echo "  - visitorId: $VISITOR_ID" >> $OUTPUT_FNAME
    echo "    firstname: $FIRSTNAME" >> $OUTPUT_FNAME
    echo "    lastname: $LASTNAME" >> $OUTPUT_FNAME
    echo "    birthdate: $BIRTHDATE" >> $OUTPUT_FNAME

    echo "    phone: $PHONE" >> $OUTPUT_FNAME
    echo "    gender: $GENDER" >> $OUTPUT_FNAME
    echo "    email: $EMAIL" >> $OUTPUT_FNAME
    echo "    interests: $INTERESTS" >> $OUTPUT_FNAME

    echo "    category: $CATEGORY" >> $OUTPUT_FNAME

    echo "    livingAddress:" >> $OUTPUT_FNAME
    echo "       city: $LIVING_ADDRESS_CITY" >> $OUTPUT_FNAME
    echo "       street: $LIVING_ADDRESS_STREET" >> $OUTPUT_FNAME
    echo "       postalCode: $LIVING_ADDRESS_POSTALCODE" >> $OUTPUT_FNAME
    echo "       additionalInfo: $LIVING_ADDRESS_ADDITIONAL_INFO" >> $OUTPUT_FNAME

    echo "    deliveryAddress: " >> $OUTPUT_FNAME
    echo "       city: $DELIVERY_ADDRESS_CITY" >> $OUTPUT_FNAME
    echo "       street: $LIVING_ADDRESS_STREET" >> $OUTPUT_FNAME
    echo "       postalCode: $LIVING_ADDRESS_POSTALCODE" >> $OUTPUT_FNAME
    echo "       additionalInfo: $LIVING_ADDRESS_ADDITIONAL_INFO" >> $OUTPUT_FNAME

    echo "    debts: $DEBTS" >> $OUTPUT_FNAME
    echo "    payments: $PAYMENTS" >> $OUTPUT_FNAME

    echo "    bankData:" >> $OUTPUT_FNAME
    echo "       cardNumber: $BANKDATA_CARD_NUMBER" >> $OUTPUT_FNAME
    echo "       bankAccount: $BANKDATA_BANK_ACCOUNT" >> $OUTPUT_FNAME
    echo "       cvvCode: $BANKDATA_CVV_CODE" >> $OUTPUT_FNAME
    echo "       expiryDate: $BANKDATA_EXPIRY_DATE" >> $OUTPUT_FNAME
    echo "       cardHolder: $BANKDATA_CARD_HOLDER" >> $OUTPUT_FNAME
}

echo ""
echo "Done!!!"



